webpackJsonp([0xa309e57a193a],{515:function(e,t){e.exports={data:{markdownRemark:{html:'<p>I was asked an interesting question by a senior web developer over a cup of coffee. The question was: "do you know how the web works?" In that moment it sounded like such a massive question, akin to "do you know how the universe works?" Both are expanding infinitely outwards and rapidly evolving and both are nearly impossible to explain in one sentence. It is impossible to \'know everything\' about something that is constantly expanding and I would guess that even astrophysicists don\'t know everything about the universe.  </p>\n<p>I have never been asked this question and I blurted out: "the entire internet?"  I think we both had a nice chuckle at my literal interpretation of the question. He followed up: "do you understand modern web protocols like <code>http</code> and <code>https</code>"? Fundamentally I understand how the internet works. At a high level, it is a superhighway of cables, wireless signals, servers and clients all communicating data with one another. Instead of people traveling on these highways, strings and numbers travel from one destination to another. However, I want to dive deeper and spend this post analyzing the layers that make up the internet. There are two primary models for explaining the functionality of the web. The TCP/IP networking model and the Open Systems Interconnection (OSI) model. This post will be a breakdown of the latter.</p>\n<h2>The Open Systems Interconnection (OSI) Model</h2>\n<p>In order to to understand the difference between various internet protocols, we need to understand the concept of a <a href="https://en.wikipedia.org/wiki/OSI_model">layered network model</a>. This model is composed of layers and each layer has protocols that allow computers to communicate with one another at different distances and at different levels of abstraction. Let\'s start our analysis at the bottom of the stack and work our way up.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/blog-gatsby/static/osi-model-fa97c1630dc51d46ed2a9850e7c3c61a-1d900.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 300px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 118.33333333333333%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="osi model"\n        title=""\n        src="/blog-gatsby/static/osi-model-fa97c1630dc51d46ed2a9850e7c3c61a-1d900.png"\n        srcset="/blog-gatsby/static/osi-model-fa97c1630dc51d46ed2a9850e7c3c61a-9445c.png 148w,\n/blog-gatsby/static/osi-model-fa97c1630dc51d46ed2a9850e7c3c61a-7af9e.png 295w,\n/blog-gatsby/static/osi-model-fa97c1630dc51d46ed2a9850e7c3c61a-1d900.png 300w"\n        sizes="(max-width: 300px) 100vw, 300px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3>Physical Layer</h3>\n<p>The bottom layer is called the physical layer and is where signals, pulses and waves transmit data from one place to another. There are not necessarily protocols present in this layer, only the engineering standards necessary for voltages, frequencies and other physical properties. It is possible to transmit data directly this way but it requires a lot of power or dedicated lines. And without the higher layers it would not be possible to share bandwidth.</p>\n<h3>Link Layer</h3>\n<p>This layer involves communication between devices that share a physical communication medium. Protocols like Ethernet, 802.11a/b/g/n/ac, Token Ring determine how to handle multiple concurrent accesses to the physical medium. One of the major functions of the data link layer is to provide a MAC address so that requested information can find its destination.</p>\n<h3>Network Layer</h3>\n<p>The network layer is where we find the Internet Protocol (IP) and it\'s where the magic of the Internet happens. Through this layer you can talk to a computer in another country without needing to know exactly where it is. IP addresses help packets navigate through the network to reach their proper destination.</p>\n<h3>Transport layer</h3>\n<p>This is the quality control layer for the internet. We can talk to computers around the world but those computers are all running lots of different applications. The transport layer communicates with the correct application through port numbers. Transmission Control Protocol (TCP) and User Datagram Protocol (UDP) are the most popular transport protocols.</p>\n<h3>Session Layer</h3>\n<p>The session layer makes it possible to establish an open communication line between two devices in order to send the requested packets. It establishes a mechanism for opening, closing and managing a session between end-user application processes and responses.</p>\n<h3>Presentation Layer</h3>\n<p>The presentation layer is responsible for the delivery and formatting of information to the application layer for further processing or display. Encryption also occurs within this layer.</p>\n<h3>Application Layer</h3>\n<p>The application layer is the top layer of the OSI model and is the user interface that the end-user interacts with to send or receive data. Application layer protocols handle requests to and from users and servers. HTTP and HTTPS are two important protocols that web developers should understand.</p>\n<h5>HTTP</h5>\n<p>HyperText Transfer Protocol (HTTP) is the foundation of data communication for the World Wide Web. It is the protocol for exchanging hypertext, the foundation of every website.  HTTP functions as a request-response protocol in the client-server computing model.</p>\n<h5>HTTPS</h5>\n<p>HTTPS or HTTP Secure is an adaption of the Hypertext Transfer Protocol for secure communication over a computer network. With HTTTP, packets travel out in the open and anyone with a packet sniffing software (like WireShark) can analyze the traffic at any point in its journey. In HTTPS, the communication protocol is encrypted by Transport Layer Security (TLS) or formerly, Secure Sockets Layer (SSL). TLS lives on a lower level in the network layer model. When a web request occurs, the TLS encryption occurs before the HTTP stuff happens. TLS uses private-public and symmetric key cryoptography for securing traffic.</p>\n<h5>Other Application Layer Protocols</h5>\n<p>SMTP, FTP, IMAP, POP, SSH, XMPP</p>\n<h3>Summary</h3>\n<p>The layered network model is a a helpful computer science concept for understanding how the internet works. The TCP/IP network model has 5 layers versus the 7 layers of the OSI model. In reality, some protocols dance between the various layers or can work within multiple layers at once. For example, TLS/SSL provides encryption and session information between the network and transport layers. API\'s exist above the application layer and govern communication for modern web applications. Hopefully this summary allowed you to think about the internet differently. I encourage you to do more research about network models as this point only scratches the surface.</p>',frontmatter:{date:"February 23, 2018",path:"/how_does_the_internet_work",title:"How Does the Internet Work?"}}},pathContext:{}}}});
